import React, { Component } from 'react';
import { Button, Card, CardBody, CardFooter, Col, Container, Form, Input, InputGroup, InputGroupAddon, InputGroupText, Row } from 'reactstrap';

class Register extends Component {
  constructor(props){
    super(props);
    this.state = {
      users:[],
      error:null
    }
  }
  componentDidMount(){
    var apiUrl  = "http://localhost/API/UserController/users";
    fetch(apiUrl)
      .then(res => res.json())
      .then((result)=>{
        this.setState({
          users:result
        });
      },
      (error)=>{
        this.setState({
          error
        });
      }
  )

  }
  render() {
    return (
      <div>
        {users.map((user)=>{
          return(
            <div key={user.Id} >
              {user.Id}
            </div>
          )
        })}
      </div>
    );
  }
}

export default Register;
